import Capa from '../imagens/menina.jpeg'

const Movie=(props)=>{
    return(

    <div className='Movie-container'>
        <p className='cover-holder'><img src={Capa} alt="foto de capa"></img></p>
        <p className='holder'>{props.title}</p>
        <p className='holder'>{props.data}</p>
        <p className='holder'>{props.valor}</p>
        <p className='holder'>{props.vaga}</p> 
        <p className='holder'>{props.descricao}</p>
    </div>

)}
export default Movie
